import React from "react"

export default function SideImage({ imageNameLeft, imageNameRight }) {
  return (
    <div className="side-image">
      <img src={imageNameLeft} alt="" className="side-image-left"/>
      <img src={imageNameRight} alt="" className="side-image-right"/>
    </div>
  )
}
